import styled from 'styled-components';

import Link from 'next/link';

const StyledNav = styled.nav``;

function Nav() {
  return (
    <StyledNav>
      <div className='app-name'>
        <p>Digital Library</p>
      </div>
      <div className='user-auth'>
        <ul>
          <li id='signin'>
            <Link href='/signin'>
              <a>Sign in</a>
            </Link>
          </li>
          <li id='signup'>
            <Link href='/signup'>
              <a>Join Now</a>
            </Link>
          </li>
        </ul>
      </div>
    </StyledNav>
  );
}

export default Nav;
